SELECT p.id
FROM chi_product AS p
LEFT OUTER JOIN chi_product_n_option AS po ON p.id = po.product_id
WHERE p.is_option = 1 AND po.product_id IS NULL;


UPDATE chi_product AS cp,
     (SELECT p.id
				FROM chi_product AS p 
				LEFT OUTER JOIN chi_product_n_option AS po ON p.id = po.product_id
				WHERE p.is_option = 1 AND po.product_id IS NULL
        ) s
    SET cp.is_option = 0
 WHERE cp.id = s.id;

